  [],\n\t\"revision_timestamp\": \"2016-01-29T13:51:53.392874\",\n\t\"name\": \"nist-electron-inelastic-mean-free-path-database-srd-71\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This database provides values of electron
  inelastic mean free paths (IMFPs) for use in quantitative surface analyses by AES
  and XPS. The database can provide IMFP information from up to three types of sources:
  calculated IMFPs from experimental optical data for a limited number of materials,
  IMFPs measured by elastic-peak electron spectroscopy for some elemental solids,
  and IMFPs from predictive formulae for all materials. The calculated and measured
  IMFPs were generally reported in journal papers at specified electron energies and
  these IMFPs were fit with appropriate functions so that IMFPs could be found by
  interpolation at intermediate energies.\",\n\t\"license_title\": \"Other License
